def n2(seq, increasing):
    seq = [int(s) for s in seq]
    seq = seq[::-1] if increasing else seq
    dp = []
    parents = []
    for i in range(len(seq)):
        if i == 0:
            dp.append(1)
            parents.append(None)
            continue
        maxParentLength = 0
        maxParentIndex = None
        for j, longest in enumerate(dp):
            if seq[j] > seq[i] and longest > maxParentLength:
                maxParentLength = longest
                maxParentIndex = j
        dp.append(maxParentLength + 1)
        parents.append(maxParentIndex)

    maxL = 0
    maxIndex = None
    for index, l in enumerate(dp):
        if l > maxL:
            maxL = l
            maxIndex = index
    tracer = maxIndex
        

    # print(parents)
    result = []
    while parents[tracer] is not None:
        if increasing:
            result.append(seq[tracer])
        else:
            result = [seq[tracer]] + result
        tracer = parents[tracer]
    if increasing:
        result.append(seq[tracer])
    else:
        result = [seq[tracer]] + result
    # print(dp)
    print(*result)
    return max(dp)

